const product = 'MacBook';
const model = ' Air';
const item = product + model;
const imageUrl =
  'https://eces.netlify.app/images/jooseounghyun.jpg';

ReactDOM.render(
  <>
    <h1>나만의 {item} 주문하기</h1>
    <img src={imageUrl} alt="제품 사진" />
  </>,
  document.getElementById('root')
);
